THE BIG CHILL meets THE GRADUATE. What could have been? What might have been? Reunions can be exciting, frustrating, exhilarating, nostalgic, one life given over to practicality while another chases lost dreams. Set against the majestic landscape of the desert, three estranged friends and former band mates &quot;celebrate&quot; turning 30, carrying their hopes, unresolved wounds and intertwined romantic baggage, in this hysterically funny and poignant look at lost loves, forgotten dreams and missed opportunity of three young adults in the final stages of giving up their youth.

Director: Gabriel Cowan
Writer: Adam Chanzit (screenplay)
Stars: Wes Bentley, Vincent Piazza, Amber Tamblyn
Genres: Drama
Country: USA
Language: English
